import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import HomePage from './Pages/HomePage'; // Import your other components as needed
import reportWebVitals from './reportWebVitals';

const router = createBrowserRouter([
  {
    path: "/",
    element: <App/>,
  },
  {
    path:"/HomePage",
    element:<HomePage />,
  }
]);

ReactDOM.render(
  <React.StrictMode>
    <Router>
      {routes}
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);

